from tkinter import *
from tkinter import ttk


dragon = ""
x0 = 900
y0 = 700
x1 = 0
y1 = 0
length = 3
heading = 1 #0 North, 1 East, 2 South, 3 West

def l0():
    global x0
    global x1
    global y0
    global y1
    global heading
    x1 = x0
    y1 = y0 - length
    canvas.create_line(x0, y0, x1, y1)
    x1 = x0 - length
    y0 = y1
    canvas.create_line(x0, y0, x1, y1) 
    x0 = x1
    heading = 3
    
    
def r0():
    global x0
    global x1
    global y0
    global y1
    global heading
    x1 = x0
    y1 = y0 - length
    canvas.create_line(x0, y0, x1, y1)
    x1 = x0 + length
    y0 = y1
    canvas.create_line(x0, y0, x1, y1) 
    x0 = x1 
    heading = 1
