root = Tk()
root.title("JuicysGame")

mainframe = ttk.Frame(root, padding="0 0 0 0")
mainframe.grid(column=0, row=0, sticky=(N, W, E, S))
root.columnconfigure(0, weight=1)
root.rowconfigure(0, weight=1)

canvas = Canvas(mainframe, width=1920, height=1080, background='red')

for x in range(8191):
    if dragon[x] == "R":
        if heading == 0:
            r0()
        elif heading == 1:
            r1()
        elif heading == 2:
            r2()
        elif heading == 3:
            r3()
    elif dragon[x] == "L":
        if heading == 0:
            l0()
        elif heading == 1:
            l1()
        elif heading == 2:
            l2()
        elif heading == 3:
            l3()
    x = x + 1

for child in mainframe.winfo_children(): 
    child.grid_configure(padx=5, pady=5)

root.mainloop() 
